script: |
  super -f text -I q4399.spq | sort > q4399.out

inputs:
  - name: q4399.spq
    data: |
      SELECT ALL + col2 FROM tab1 (FORMAT parquet) cor0 WHERE ( col2 * 23 ) NOT IN ( col1, - col2 * - + col0 + - col0 + - - 97 );
  - name: tab1

outputs:
  - name: q4399.out
    data: |
      59
      68
      96
